package practice;

public class RelationalOperators {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
      
		int a, b;
		a=40;
		b=30;
		System.out.println("a == b = " + (a == b));
		
		System.out.println("a != b = " + (a != b));
		
		System.out.println("a > b = " + (a > b));
		
		System.out.println("a < b = " + (a < a));
		
		System.out.println("b >= a =" + (b >= a));
		
		System.out.println("b <= a = " + (b <= a));
	}

}
